import React, { Component } from "react";
import { Checkbox } from "semantic-ui-react";

export default class Test extends Component {
  constructor() {
    super();
    this.state = {
      cars: [
        { plate: "WHI-263", active: false },
        { plate: "CKN-363", active: true }
      ]
    };
  }
  handleChange = () => {
  }
  render() {
    return this.state.cars.map((car, id) => {
      return <Checkbox key={car.id} label={<label>{car.plate} onChange={this.handleChange}</label>} />;
    });
  }
}
